import React from 'react'
import { useNavigate } from 'react-router-dom'

const ProtectedRoute = ({children,user}) => {

    const navigate = useNavigate();

    if(!user){
        <navigate to="/"></navigate>

    } else {
        return children;
    }
  return (
    <div>
      
    </div>
  )
}

export default ProtectedRoute
